def bottom_up_cut_rod(p, n):
    """"""
    r = [0 for _ in range(n + 1)]
    s = [0 for _ in range(n + 1)]
    for j in range(1, n + 1):
        q = -1
        for i in range(1, j + 1):
            if q < p[i] + r[j - i]:
                q = p[i] + r[j - i]
                s[j] = i
        r[j] = q
    cut_sizes = []
    while n > 0:
        cut_sizes.append(s[n])
        n = n - s[n]
    return (r[-1], cut_sizes)
